import React from 'react';
import Text from "../helpers/Text";
import {Link} from "react-router-dom";

function TextLink({
                      fontWeight = 600,
                      text,
                      color,
                      size,
                      to
                  }) {
    return (
        <Link to={to}>
            <div style={{
                textDecoration:"none",
                color:"inherit"
            }}>
                <Text fontWeight={fontWeight} text={text} color={color} size={size} hover={{
                    cursor: "pointer",
                    color: "#D24A6A"
                }}></Text>
            </div>

        </Link>
    );
}

export default TextLink;
